import React, { useState } from 'react'
import Box from './Box'

const App5 = () => {
    let [a, setA] = useState(0);
  return (
    <>
        <h1>Home Page</h1>
        <button onClick={()=>setA(a+1)}>OK</button>;
        <h2>{a}</h2>
        <Box />
    </>
  )
}

export default App5
